import React, { useEffect, useRef } from "react";
import { LineChart, LineChartProps } from "@opd/g2plot-react";
import { Line } from "@antv/g2plot";

const config = LineChartProps = {
  padding: "auto",
  autoFit: true,
  data: [
    { year: "1991", value: 3 },
    { year: "1992", value: 4 },
    { year: "1993", value: 3.5 },
    { year: "1994", value: 5 },
    { year: "1995", value: 4.9 },
    { year: "1996", value: 6 },
    { year: "1997", value: 7 },
    { year: "1998", value: 9 },
    { year: "1999", value: 13 }
  ],
  xField: "year",
  yField: "value",
  smooth: true,
  meta: {
    year: {
      alias: "年份"
    },
    value: {
      alias: "人数(亿)"
    }
  }
};

function Graph1() {
  
  return (
    <div>
      <LineChart />
    </div>
  )
}

export default Graph1
